var sortRandom = function() {
	if (!mode && ordered) {
		var fullQueue = $.jStorage.get(dataset.active).concat($.jStorage.get(dataset.queue));
		var fullLength = fullQueue.length;
		if ($('#sort-levels').is(':checked')) {
			var level = highestPriorityLevel();
			var sorted = fullQueue.filter(function(ele) {
				return ele.level == level;
			});
			if ($('#sort-types').is(':checked')) {
				var prioritySort = sorted.sort(function(a, b) {
					var sortA = (a.rad ? rad : a.kan ? kan : voc);
					var sortB = (b.rad ? rad : b.kan ? kan : voc);
					return sortA - sortB;
				});
				var priority = prioritySort[0].rad ? 'radical' : prioritySort[0].kan ? 'kanji' : 'vocabulary';
				sorted = sorted.filter(function(ele) {
					return priority === 'radical' && ele.rad || priority === 'kanji' && ele.kan || priority === 'vocabulary' && ele.voc;
				});
			}
			fullQueue = sorted;
		} else if ($('#sort-types').is(':checked')) {
			var priority = highestPriorityType();
			fullQueue = fullQueue.filter(function(ele) {
				return priority === 'radical' && ele.rad || priority === 'kanji' && ele.kan || priority === 'vocabulary' && ele.voc;
			});
		}
		return Math.floor(oldRandom() * Math.min(10, fullQueue.length)) / Math.max(fullLength, 1);
	}
	return mode ? 0 : oldRandom();
};

function highestPriorityType() {
	return $('#types item').not('.hidden').first().attr('class');
}

function highestPriorityLevel() {
	return parseInt($('#levels item').not('.hidden').first().text());
}

