function reorder(levelRemoval) {
	ordered = true;
	newRandom();
    rad = $('#types .radical').index();
    kan = $('#types .kanji').index();
    voc = $('#types .vocabulary').index();
    var fullQueue = $.jStorage.get(dataset.queue);
    var activeQueue = $.jStorage.get(dataset.active);
    var queueSize = activeQueue.length;
    fullQueue = fullQueue.concat(activeQueue);
    if (levelRemoval) {
        fullQueue = fullQueue.filter(function(ele) {
            return ele.level != levelRemoval;
        });
		if (fullQueue.length === 0) {
			window.location = '/review/';
			return;
		}
    }
    fullQueue = fullQueue.filter(function(ele) {
        return $('#types .radical.hidden').length === 0 && ele.rad || $('#types .kanji.hidden').length === 0 && ele.kan || $('#types .vocabulary.hidden').length === 0 && ele.voc;
    });
    if ($('#sort-levels').is(':checked')) {
        $('#levels > item').each(function() {
            var level = parseInt(this.innerHTML);
            var sorted = fullQueue.filter(function(ele) {
                return ele.level == level;
            });
            if ($('#sort-types').is(':checked')) {
                sorted.sort(function(a, b) {
                    var sortA = (a.rad ? rad : a.kan ? kan : voc);
                    var sortB = (b.rad ? rad : b.kan ? kan : voc);
                    return sortA - sortB;
                });
            }
            fullQueue = fullQueue.filter(function(ele) {
                return ele.level != level;
            }).concat(sorted);
        });
    } else if ($('#sort-types').is(':checked')) {
        fullQueue.sort(function(a, b) {
            var sortA = (a.rad ? rad : a.kan ? kan : voc);
            var sortB = (b.rad ? rad : b.kan ? kan : voc);
            return sortA - sortB;
        });
    } else {
        fullQueue.sort(function() {
			return 0.5 - oldRandom();
		});
    }
    if (dataset.queue === 'reviewQueue') {
        activeQueue = fullQueue;
        fullQueue = [];
    } else {
        activeQueue = fullQueue.splice(0, queueSize);
        fullQueue = fullQueue;
    }
	$.jStorage.set(dataset.active, activeQueue);
	$.jStorage.set(dataset.queue, fullQueue);
    dataset.updateVisual();
}

function toUID(item) {
    return (item.rad ? 'r' : item.kan ? 'k' : 'v') + item.id;
}

var setup = setInterval(function() {
	if ($('div[id*="loading"]:visible').length === 0) {
		makeUI();
		var uiHelper = setInterval(function() {
			if ($('.sortable').length > 0) {
				var fq = $.jStorage.get(dataset.queue);
				var aq = $.jStorage.get(dataset.active);
				fq = fq.concat(aq);
				if (fq.length === 0) {
					console.log("There are no options available... Removing UI.");
-					$('.ui').remove();
				} else {
					if ($(fq).filter(function() {
							return this.rad;
						}).length === 0) {
						if ($('.radical.hidden').length === 0) {
							console.log("There are no radical items... Hiding option.");
							$('#types .radical').addClass('hidden');
						}
					}
					if ($(fq).filter(function() {
							return this.kan;
						}).length === 0) {
						if ($('.kanji.hidden').length === 0) {
							console.log("There are no kanji items... Hiding option.");
							$('#types .kanji').addClass('hidden');
						}
					}
					if ($(fq).filter(function() {
							return this.voc;
						}).length === 0) {
						if ($('.vocabulary.hidden').length === 0) {
							console.log("There are no vocabulary items... Hiding option.");
							$('#types .vocabulary').addClass('hidden');
						}
					}
					activeLevels.forEach(function(level) {
						if (fq.filter(function(ele) {
								return ele.level == level;
							}).length === 0) {
							if ($('#level-' + level + '.hidden').length === 0) {
								console.log("Level " + level + " has no more items...  Hiding option.");
								$('#level-' + level).addClass('hidden');
							}
						}
					});
					var quiz = $('#quiz');
					if (quiz.is(':visible')) {
						$('.ui').hide();
					} else {
						$('.ui').show();
						$('input[type="checkbox"]:disabled').removeAttr('disabled');
					}
				}
			} else {
				clearInterval(uiHelper);
			}
		}, 100);
		clearInterval(setup);
	}
}, 100);

function newRandom() {
	Math.random = sortRandom;
}